// import dependencies
import { useNavigate } from "react-router-dom";
import { useSelector, useDispatch } from "react-redux";

// import components
import { Navlink2 } from "../../utils/links";

// redux
import { logout, reset } from "../../../redux/auth/authReducer";

// import components
// utils
import PrivateRoute from "../../utils/PrivateRoute.js";

// import styles
import "./style.min.css";

const Dashboard = () => {
  const navigate = useNavigate();
  const dispatch = useDispatch();
  const { user } = useSelector((state) => state.auth);

  console.log(user);

  const onLogout = () => {
    dispatch(logout());
    dispatch(reset());
    navigate("/");
  };

  const content = (
    <div className="dashboard">
      <Navlink2 text="ADD-BLOG" link="/newblog" />
      <Navlink2 text="ADD-SKILL" link="/newskill" />
      <Navlink2 text="ADD-WORK" link="/newwork" />
      <Navlink2 text="UPDATE-PROFILE" link="/updateprofile" />
      <div onClick={onLogout}>LOGOUT</div>
    </div>
  );

  return <PrivateRoute content={content} title="Dashboard" />;
};

export default Dashboard;
